import React from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import {withRouter} from 'react-router-dom';
import {connect} from 'react-redux';
import {bindActionCreators} from 'redux';
import './productlistpage.css';
class Productlistpage extends React.Component{
   constructor(props){
     super(props);
     this.state = {
       contList : []
     }
     this.productFetch = this.productFetch.bind(this);
     this.product = this.product.bind(this);
   }  

   productFetch(){
     axios.post('http://localhost:3200/api/fetchProduct',{
       userId: this.props.userId,
       productId :  this.props.productId,
       email: this.props.email,
     }).then((resp)=>{
       console.log('##################',resp.data.user);
       this.setState({
        contList: resp.data.user,
       })
      //  console.log('kkkkkkkkkkkk',this.state.contList);
     })
   }

   componentDidMount (){
     this.productFetch();
   }

   product(){
     let obj = {};
     obj.productId = this.props.productId,
     userId = this.props.userId,
     console.log('AAAAAAAAAAAAAAAAAAAA',obj);
    axios.post('http://localhost:3200/api/fetchProduct',obj).then((response)=>{
      console.log('---------------------------',response);
    })
   }

	render(){
    console.log('qqqqqqqqq',this.props.productId);
		return(
        <div className="my-3 my-md-5">
          <div className="container">
            <div className="page-header">
              <h4 className="page-title">Product List</h4>
              <ol className="breadcrumb">
                <li className="breadcrumb-item"><a href="#">Home</a></li>
                <li className="breadcrumb-item active" aria-current="page">Product List</li>
              </ol>
            </div>
            <div className="row">
              <div className="col-md-12 col-lg-12">
              <div className="card">
                <div className="card-body">
                                  <div className="table-responsive">
                  <table id="example" className="table table-striped table-bordered">
                    <thead>
                      <tr>
                        <th className="wd-15p">Product Id</th>
                        <th className="wd-15p">Category</th>
                        <th className="wd-15p">Product Name</th>
                        <th className="wd-20p">Price</th>
                        <th className="wd-20p">Quantity</th>
                        <th className="wd-15p">Discount</th>
                        <th className="wd-25p">Status</th>
                        <th className="wd-25p">Action</th>
                      </tr>
                    </thead>
                    <tbody>
                      {
                        this.state.contList.map((e,i)=>{
                          return(
                            <React.Fragment key = {i}>
                                  <tr>
                              <td>#P1001</td>
                              <td>{e.category}</td>
                              <td>{e.productName}</td>
                              <td>{e.productPrice}</td>
                              <td>{e.quantity}</td>
                              <td>{e.discount}</td>
                        <td>
                        <div className="card-options">
                            <label className="custom-switch m-0">
                              <input type="checkbox" value="1" className="custom-switch-input" />
                              <span className="custom-switch-indicator"></span>
                            </label>
                          </div>
                        </td>
                        <td>
                          <div className="actiontrans">
                            <a href="#" onClick = {this.product}>View Detail </a>
                          </div>
                        </td>
                      </tr>
                             </React.Fragment>
                          )
                        })
                      }
                    </tbody>
                  </table>
                </div>
                                </div>
              </div>
              </div>
            </div>
          </div>
        </div>


			)
	}
}

function mapStateToProps(state){
  console.log('pppppppppppppppppppppp',state.productReducer.productId);
  return {
    authenticateState : state.inititateState.authenticateState,
    email: state.inititateState.email,
    userId: state.inititateState.userId,
    product : state.productReducer.product,
    productId : state.productReducer.productId,
  }
}

export default withRouter(connect(mapStateToProps)(Productlistpage));
